    false,nt"url": null,nt"notes": "The Jail Bookings Open Data dataset is
    provided by the King County Department of Adult and Juvenile Detention. The dataset
    contains adult jail bookings which have occurred within the last twelve months;
    specific dates are indicated on the web site. rnrnThe data provided is a snapshot
    and is current as of the date and time it was extracted from the jail management
    systems. Every effort has been made to ensure the accuracy of data listed at the
    time of extraction. Updates, corrections, and additions may have occurred since
    the extraction date and time. rnrnThis dataset provides information associated with
    the booking of an individual into a King County jail facility, and not with any
    court cause, case, or criminal filing pursuant to the booking event. This information
    does not reflect the criminal history or criminal status of any inmate currently
    or previously in custody. rnrnCurrent information about a specific booking event
    can be obtained by calling the Department of Adult and Juvenile Detention at (206)
    296-1234 or by visiting our Jail Inmate Lookup Service (JILS). http://ingress.kingcounty.gov/inmatelookup/",nt"license_title":
